    def Rz(self, z_start, z_finish, Z, R, Restriction, Condition):
        zr = np.arange(z_start, z_finish, 0.01)
        Rzt = array([0.0] * len(zr))
        j = -1

        for z in zr:
            j += 1
            if eval(Restriction[0]):
                Rzt[j] = eval(Condition[0])
            elif eval(Restriction[1]):
                Rzt[j] = eval(Condition[1])
            elif eval(Restriction[2]):
                Rzt[j] = eval(Condition[2])
            elif eval(Restriction[3]):
                Rzt[j] = eval(Condition[3])
            elif eval(Restriction[4]):
                Rzt[j] = eval(Condition[4])
            elif eval(Restriction[5]):
                Rzt[j] = eval(Condition[5])
            elif eval(Restriction[6]):
                Rzt[j] = eval(Condition[6])
            elif eval(Restriction[7]):
                Rzt[j] = eval(Condition[7])
            elif eval(Restriction[8]):
                Rzt[j] = eval(Condition[8])
            elif eval(Restriction[9]):
                Rzt[j] = eval(Condition[9])

        plt.xlabel('z, мм', fontsize=18, fontweight="bold")
        plt.ylabel('R(z), мм', fontsize=18, fontweight="bold")
        plt.tick_params(axis='both', which='major', labelsize=20)
        plt.grid(True)
        plt.plot(zr, Rzt, "b")
        plt.plot(zr, -Rzt, "b")
        plt.show()

