            mu0 = 4 * np.pi * 10 ** (-7)  # мю 0
            epsilon0 = 8.854187935757958 * 10 ** (-12)
            e0 = 1.602176620898 * 10 ** (-19)
            m0 = 9.10938356 * 10 ** (-31)
            mm = 10 ** (-3)
