            #  numn = "функция бесселя"
            #  omega0 = c0 * numn / R0
            #  f0 = omega0 / 2 * pi

            """ Сетка по координате """
            znorm = L
            z1 = z_start
            zN = z_finish
            NN = round(((zN - z1) / dz))
            zi = arange(z1, zN, dz)
            ksii = zi / znorm
            Delksi = dz / znorm

            """Сдвиг"""
            #Omega0 = (numn * dz / L) ** 2 * OmegaL2divR20
            #Shift0 = (numn * dz / L) ** 2 * Shift

            """Память под массивы"""
            Ri = np.array([0.0] * NN)
            deltai = np.array([0.0] * NN)
            di = np.array([0.0] * NN)

            """Массив радиусов"""
            Ri = map(self.Rz, zi)


            self.Rz(z_start, z_finish, Z, R, Restriction, Condition)

